    24 on November 6 was for a communication that was disseminated on November 4 that
    was not authorized by the committee.  Several advertisements were considered for
    that date. This ad was among those was not approved and the newspaper was not
    authorized to run the ad.  The committee was unaware of the newspaper's error
    of placing the ad until receipt of an invoice on November 6.  While not approved
    and authorized, the ad had been printed so the committee elected to pay the invoice.
    \ To best serve public disclosure needs, the committee immediately filed a 24-notice
    for the unauthorized ad anyway.\n"
